package parser

import (
	"github.com/antchfx/htmlquery"
	"golang.org/x/net/html"
	"jy/douban/engine"
	"jy/douban/model"
	"log"
	"regexp"
	"strconv"
	"strings"
)

func Detail_parser(resp *html.Node) engine.ParserResult{
	sss := ""
	Profile := model.Profile{}
	//标题
	Profile.Title = get_title(resp)
	//发帖日期
	Profile.Data = get_data(resp)
	//描述
	textlist := htmlquery.Find(resp,`//div[@class="topic-richtext"]/p`)
	for _,m := range textlist{
		sss = sss + strings.TrimSpace(htmlquery.InnerText(m))
	}
	Profile.Text =Profile.Title + sss
	//帖子的唯一url
	url := htmlquery.SelectAttr(htmlquery.FindOne(resp,`//div[@class="tabs"]/a`),"href")
	if len(url)>6{
		Profile.Url = url[:len(url)-5]
		//帖子id
		re, _ := regexp.Compile(`\d+`)
		all := re.FindAll([]byte(Profile.Url),-1)
		for _,item := range all {
			Profile.Id = Profile.Id + string(item)
		}
		if len(Profile.Id)!=9{
			Profile.Id = "100000000"
		}
	}else {
		Profile.Id = "100000000"
		Profile.Url = "https://douban.com"
	}
	//唯一id,用正则去匹配
	//图片地址集合
	images := htmlquery.Find(resp,`//div[@class="topic-richtext"]/div[@class="image-container image-float-center"]`)
	//fmt.Println(len(images))
	if len(images)==0{
		noimage_url := "https://s2.ax1x.com/2019/08/12/exmwLQ.th.jpg"
		Profile.Image_url = append(Profile.Image_url, model.Urls{Url:noimage_url})
	}else {
		for _,image := range images{
			image_url := htmlquery.SelectAttr(htmlquery.FindOne(image,`//div[@class="image-wrapper"]/img`),"src")
			Profile.Image_url = append(Profile.Image_url, model.Urls{Url:image_url})
		}
	}
	//整租 合租
	Profile.Method = get_method(Profile.Text)
	//城中村 小区
	Profile.Type = get_type(Profile.Text)
	//具体区域
	Profile.Xiaoqu = get_xiaoqu(Profile.Text)
	//大区
	Profile.Daqu = "3"
	//求租
	Profile.Qiu = get_qiuzu(Profile.Text)

	result := engine.ParserResult{}
	result.Items = append(result.Items, Profile)
	return result
}
//评价是否是整租
func get_method(content string) string{
	p := model.Profile{}
	p.Method = "0"
	if strings.Contains(content,"合租")||strings.Contains(content,"主卧")||strings.Contains(content,"次卧")||strings.Contains(content,"小卧")||strings.Contains(content,"独立")||strings.Contains(content,"独卫"){
		p.Method = p.Method + " "+strconv.Itoa(2)
	}else{
		p.Method = p.Method +" "+strconv.Itoa(1)
	}
	return p.Method
}
