//评价是否是求租
func get_qiuzu(content string)string{
	p := model.Profile{}
	p.Qiu = "0"
	if strings.Contains(content,"求整租")||strings.Contains(content,"求合租")||strings.Contains(content,"求租")||strings.Contains(content,"找舍友")||strings.Contains(content,"找舍友")||strings.Contains(content,"找室友")||strings.Contains(content,"求舍友")||strings.Contains(content,"求室友"){
		p.Qiu = "1"
	}else {
		if strings.Contains(content,"求")&&!strings.Contains(content,"要求"){
			p.Qiu = p.Qiu + " "+strconv.Itoa(1)
		}
	}
	return p.Qiu
}
func get_title(resp *html.Node) (title string) {
	defer func() {
		r := recover()
		if r!=nil{
			title = "该帖子已经关闭"
			log.Println("标题结尾是三个...")
		}
	}()
	title = strings.TrimSpace(htmlquery.InnerText(htmlquery.FindOne(resp,`//div[@id="content"]/h1`)))
	if len(title) > 4{
		if title[len(title)-3:len(title)]=="..."{
			title = strings.TrimSpace(htmlquery.InnerText(htmlquery.FindOne(resp,`//td[@class="tablecc"]`)))[9:]
		}else{
			title = title
		}
	}else {
		title = "该帖子已经关闭"
	}
	return title
}
